"use client"

import { useState, useEffect } from "react"
import { Calendar, Download, FileText, Filter, ChevronDown, Home, Menu } from "lucide-react"
import { Button } from "@/components/ui/button"
import { Select, SelectContent, SelectItem, SelectTrigger, SelectValue } from "@/components/ui/select"
import { toast } from "sonner"
import { Sheet, SheetContent, SheetTrigger } from "@/components/ui/sheet"
import jsPDF from 'jspdf'
import autoTable from 'jspdf-autotable'
import Link from "next/link"

// Extend jsPDF with autoTable
declare module 'jspdf' {
  interface jsPDF {
    autoTable: (options: any) => jsPDF
  }
}

export default function LaporanPage() {
  const [peminjaman, setPeminjaman] = useState<any[]>([])
  const [loading, setLoading] = useState(true)
  const [bulan, setBulan] = useState<string>(new Date().getMonth().toString())
  const [tahun, setTahun] = useState<string>(new Date().getFullYear().toString())
  const [generatingPdf, setGeneratingPdf] = useState(false)
  const [sidebarOpen, setSidebarOpen] = useState(false)

  useEffect(() => {
    fetchPeminjaman()
  }, [bulan, tahun])

  const fetchPeminjaman = async () => {
    try {
      setLoading(true)
      const response = await fetch('/api/peminjaman')
      const data = await response.json()
      setPeminjaman(data)
    } catch (error) {
      console.error('Error fetching peminjaman:', error)
      toast.error("Gagal memuat data peminjaman")
    } finally {
      setLoading(false)
    }
  }

  const filteredPeminjaman = peminjaman.filter(item => {
    const date = new Date(item.startDate)
    return date.getMonth() === parseInt(bulan) && date.getFullYear() === parseInt(tahun)
  }).sort((a, b) => new Date(a.startDate).getTime() - new Date(b.startDate).getTime())

  const totalPeminjaman = filteredPeminjaman.length
  const totalDisetujui = filteredPeminjaman.filter(item => item.status === 'approved').length
  const totalDitolak = filteredPeminjaman.filter(item => item.status === 'rejected').length
  const totalMenunggu = filteredPeminjaman.filter(item => item.status === 'pending').length

  const formatDate = (dateString: string) => {
    const date = new Date(dateString)
    return date.toLocaleDateString('id-ID', { day: 'numeric', month: 'long', year: 'numeric' })
  }

  const formatTime = (timeString: string) => {
    const time = new Date(timeString)
    return time.toLocaleTimeString('id-ID', { hour: '2-digit', minute: '2-digit', hour12: false })
  }

  const getNamaBulan = (bulanIndex: string) => {
    const namaBulan = ['Januari', 'Februari', 'Maret', 'April', 'Mei', 'Juni', 'Juli', 'Agustus', 'September', 'Oktober', 'November', 'Desember']
    return namaBulan[parseInt(bulanIndex)]
  }
  
  const getStatusText = (status: string) => {
    switch (status) {
      case 'approved': return 'Disetujui'
      case 'rejected': return 'Ditolak'
      case 'pending': return 'Menunggu'
      default: return status
    }
  }

  const getVehicleTypeText = (type: string) => {
    switch (type) {
      case 'car': return 'Mobil'
      case 'motorcycle': return 'Motor'
      case 'pickup': return 'Pickup'
      case 'ambulance': return 'Ambulans'
      default: return type
    }
  }

  const generatePDF = () => {
    try {
      setGeneratingPdf(true)
      const doc = new jsPDF({compress : true})
      
      const logoBase64 = ""; // Ganti dengan base64 asli Logo.png
      doc.addImage(logoBase64, 'PNG', 14, 10, 22, 22); // x, y, width, height
      doc.setFontSize(16);
      doc.setFont('helvetica', 'bold');
      doc.text("PusbangSDM BKN", 38, 22); // Disesuaikan agar lebih dekat dengan logo
      
      doc.setFontSize(15);
      doc.setFont('helvetica', 'normal');
      doc.text(`Laporan Peminjaman Kendaraan - ${getNamaBulan(bulan)} ${tahun}`, 14, 38);
      
      doc.setFontSize(12);
      let statY = 48; // Menambah jarak dari judul
      doc.text(`Total Peminjaman: ${totalPeminjaman}`, 14, statY);
      doc.text(`Disetujui: ${totalDisetujui}`, 14, statY + 7);
      doc.text(`Ditolak: ${totalDitolak}`, 14, statY + 14);
      doc.text(`Menunggu: ${totalMenunggu}`, 14, statY + 21);
      
      const tableColumn = ["No", "Nama", "Tanggal", "Waktu", "Kendaraan", "Tujuan", "Status"]
      const tableRows = filteredPeminjaman.map((item, index) => [
        index + 1,
        item.nama,
        formatDate(item.startDate),
        `${item.startTime} - ${item.endTime}`,
        getVehicleTypeText(item.vehicleType),
        item.purpose || '-',
        getStatusText(item.status)
      ])
      
      autoTable(doc, {
        head: [tableColumn],
        body: tableRows,
        startY: statY + 30, // Disesuaikan agar tidak tumpang tindih
        theme: 'grid',
        styles: { fontSize: 8, cellPadding: 2 },
        headStyles: { fillColor: [75, 75, 250], textColor: 255 },
        alternateRowStyles: { fillColor: [240, 240, 255] }
      })
      
      const pageCount = doc.getNumberOfPages ? doc.getNumberOfPages() : (doc as any).internal.getNumberOfPages();
      for (let i = 1; i <= pageCount; i++) {
        doc.setPage(i)
        doc.setFontSize(8)
        doc.text(
          `Dicetak pada: ${new Date().toLocaleDateString('id-ID')} ${new Date().toLocaleTimeString('id-ID')}`,
          14,
          doc.internal.pageSize.height - 10
        )
        doc.text(
          `Halaman ${i} dari ${pageCount}`,
          doc.internal.pageSize.width - 30,
          doc.internal.pageSize.height - 10
        )
      }
      
      doc.save(`Laporan_Peminjaman_${getNamaBulan(bulan)}_${tahun}.pdf`)
      toast.success("Laporan berhasil diunduh")
    } catch (error) {
      console.error('Error generating PDF:', error)
      toast.error("Gagal mengunduh laporan")
    } finally {
      setGeneratingPdf(false)
    }
  }

  return (
    <div className="min-h-screen bg-gray-50 flex">
      {/* Sidebar Desktop */}
      <div className="hidden md:flex md:w-64 md:flex-col md:fixed md:inset-y-0">
        <div className="flex flex-col flex-grow border-r border-gray-200 bg-white pt-5 pb-4 overflow-y-auto">
          <div className="flex items-center flex-shrink-0 px-4 gap-3">
            <div className="h-10 w-10 rounded-full bg-purple-600 flex items-center justify-center">
              <FileText className="h-5 w-5 text-white" />
            </div>
            <h1 className="text-xl font-bold">PusbangSDM BKN</h1>
          </div>
          <nav className="mt-5 flex-1 px-2 space-y-1">
            <Link href="/dashboard" className="w-full">
              <Button variant="ghost" className="w-full justify-start gap-3"><Home className="h-5 w-5" />Dashboard</Button>
            </Link>
            <Link href="/peminjaman" className="w-full">
              <Button variant="ghost" className="w-full justify-start gap-3"><Calendar className="h-5 w-5" />Peminjaman</Button>
            </Link>
            <Link href="/laporan" className="w-full">
              <Button variant="secondary" className="w-full justify-start gap-3"><FileText className="h-5 w-5" />Laporan</Button>
            </Link>
          </nav>
        </div>
      </div>
      
      <div className="md:pl-64 flex flex-col flex-1">
        <div className="sticky top-0 z-10 md:hidden pl-1 pt-1 sm:pl-3 sm:pt-3 bg-gray-100">
            <Sheet open={sidebarOpen} onOpenChange={setSidebarOpen}>
                <SheetTrigger asChild>
                    <Button variant="ghost" className="p-2 rounded-full shadow-sm" onClick={() => setSidebarOpen(true)}>
                        <Menu className="h-6 w-6 text-gray-700" />
                    </Button>
                </SheetTrigger>
                <SheetContent side="left" className="p-0 w-64">
                    <div className="flex items-center gap-3 mb-6 p-4 border-b">
                        <div className="h-10 w-10 rounded-full bg-purple-600 flex items-center justify-center">
                            <FileText className="h-5 w-5 text-white" />
                        </div>
                        <h1 className="text-xl font-bold">PusbangSDM BKN</h1>
                    </div>
                    <nav className="space-y-1 p-4">
                        <Link href="/dashboard"><Button variant="ghost" className="w-full justify-start gap-3"><Home className="h-5 w-5" />Dashboard</Button></Link>
                        <Link href="/peminjaman"><Button variant="ghost" className="w-full justify-start gap-3"><Calendar className="h-5 w-5" />Peminjaman</Button></Link>
                        <Link href="/laporan"><Button variant="secondary" className="w-full justify-start gap-3"><FileText className="h-5 w-5" />Laporan</Button></Link>
                    </nav>
                </SheetContent>
            </Sheet>
        </div>

        <main className="flex-1 p-4 md:p-8">
            <h1 className="text-2xl font-bold text-gray-800 mb-6">Laporan Peminjaman</h1>

            <div className="bg-white rounded-xl shadow-md mb-6 p-4">
                <div className="flex flex-col sm:flex-row flex-wrap gap-4 items-center">
                    <div className="flex-grow">
                        <label className="block text-sm font-medium text-gray-700 mb-1">Bulan</label>
                        <Select value={bulan} onValueChange={setBulan}>
                            <SelectTrigger className="w-full sm:w-[180px]"><SelectValue /></SelectTrigger>
                            <SelectContent>
                                {Array.from({ length: 12 }, (_, i) => (<SelectItem key={i} value={i.toString()}>{getNamaBulan(i.toString())}</SelectItem>))}
                            </SelectContent>
                        </Select>
                    </div>
                    <div className="flex-grow">
                        <label className="block text-sm font-medium text-gray-700 mb-1">Tahun</label>
                        <Select value={tahun} onValueChange={setTahun}>
                            <SelectTrigger className="w-full sm:w-[180px]"><SelectValue /></SelectTrigger>
                            <SelectContent>
                                {Array.from({ length: 5 }, (_, i) => { const year = new Date().getFullYear() - 2 + i; return (<SelectItem key={i} value={year.toString()}>{year}</SelectItem>)})}
                            </SelectContent>
                        </Select>
                    </div>
                    <div className="flex-shrink-0 mt-4 sm:mt-0 self-end">
                        <Button onClick={generatePDF} disabled={generatingPdf || filteredPeminjaman.length === 0} className="w-full sm:w-auto">
                            <Download className="h-4 w-4 mr-2" />
                            {generatingPdf ? 'Mengunduh...' : 'Unduh PDF'}
                        </Button>
                    </div>
                </div>
            </div>

            <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-4 mb-8">
                <div className="bg-white rounded-lg shadow p-5">
                    <h4 className="text-sm font-medium text-gray-500">Total Peminjaman</h4>
                    <p className="text-3xl font-bold mt-1">{totalPeminjaman}</p>
                </div>
                <div className="bg-white rounded-lg shadow p-5">
                    <h4 className="text-sm font-medium text-gray-500">Disetujui</h4>
                    <p className="text-3xl font-bold mt-1 text-green-600">{totalDisetujui}</p>
                </div>
                <div className="bg-white rounded-lg shadow p-5">
                    <h4 className="text-sm font-medium text-gray-500">Ditolak</h4>
                    <p className="text-3xl font-bold mt-1 text-red-600">{totalDitolak}</p>
                </div>
                <div className="bg-white rounded-lg shadow p-5">
                    <h4 className="text-sm font-medium text-gray-500">Menunggu</h4>
                    <p className="text-3xl font-bold mt-1 text-yellow-600">{totalMenunggu}</p>
                </div>
            </div>
            
            <div className="bg-white rounded-xl shadow-md overflow-hidden">
            {loading ? (
                <div className="p-8 text-center text-gray-500">Memuat data...</div>
            ) : filteredPeminjaman.length === 0 ? (
                <div className="p-8 text-center text-gray-500">Tidak ada data untuk periode ini.</div>
            ) : (
                <div className="overflow-x-auto">
                <table className="min-w-full divide-y divide-gray-200">
                    <thead className="bg-gray-50">
                    <tr>
                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">No</th>
                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Nama</th>
                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Detail</th>
                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider hidden sm:table-cell">Kendaraan</th>
                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Status</th>
                    </tr>
                    </thead>
                    <tbody className="bg-white divide-y divide-gray-200">
                    {filteredPeminjaman.map((item, index) => (
                        <tr key={item.id}>
                        <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">{index + 1}</td>
                        <td className="px-6 py-4 whitespace-nowrap">
                            <div className="text-sm font-medium text-gray-900">{item.nama}</div>
                        </td>
                        <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                            <div>{formatDate(item.startDate)}</div>
                            <div className="text-xs">{`${item.startTime} - ${item.endTime}`}</div>
                        </td>
                        <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500 hidden sm:table-cell">{getVehicleTypeText(item.vehicleType)}</td>
                        <td className="px-6 py-4 whitespace-nowrap">
                            <span className={`px-2 inline-flex text-xs leading-5 font-semibold rounded-full 
                            ${item.status === 'approved' ? 'bg-green-100 text-green-800' : ''}
                            ${item.status === 'rejected' ? 'bg-red-100 text-red-800' : ''}
                            ${item.status === 'pending' ? 'bg-yellow-100 text-yellow-800' : ''}
                            `}>
                            {getStatusText(item.status)}
                            </span>
                        </td>
                        </tr>
                    ))}
                    </tbody>
                </table>
                </div>
            )}
            </div>
        </main>
      </div>
    </div>
  )
}